public int compareTo(PurgeElement e) {
  if (e == null) {
    throw new NullPointerException("Null element passed to compareTo");
  }
  int ret = this.timestamp.compareTo(e.timestamp);
  if (ret != 0) {
    return ret;
  }
  return this.message.compareTo(e.message);
}
